u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"124377","type":"Paragraph"},{"attributes":{},"id":"124179","type":"UnionRenderers"},{"attributes":{"source":{"id":"124152"}},"id":"124156","type":"CDSView"},{"attributes":{},"id":"124241","type":"SaveTool"},{"attributes":{"text":"Casos Acumulados no Municipio: Jo\u00e3o Pessoa(Proje\u00e7\u00e3o com Taxa de Isolamento)"},"id":"124062","type":"Title"},{"attributes":{"axis":{"id":"124076"},"dimension":1,"ticker":null},"id":"124079","type":"Grid"},{"attributes":{},"id":"124180","type":"Selection"},{"attributes":{"label":{"value":"Mantida no \u00daltimo Valor"},"renderers":[{"id":"124097"}]},"id":"124118","type":"LegendItem"},{"attributes":{},"id":"124397","type":"Selection"},{"attributes":{"line_alpha":0.1,"line_color":"#fb9a99","line_width":1.5,"x":{"field":"x"},"y":{"field":"y"}},"id":"124184","type":"Line"},{"attributes":{"data_source":{"id":"124119"},"glyph":{"id":"124120"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"124121"},"selection_glyph":null,"view":{"id":"124123"}},"id":"124122","type":"GlyphRenderer"},{"attributes":{"axis":{"id":"124234"},"dimension":1,"ticker":null},"id":"124237","type":"Grid"},{"attributes":{"dimension":"height","line_dash":[6],"line_width":0.5,"location":1591574400000.0},"id":"124372","type":"Span"},{"attributes":{},"id":"124148","type":"Selection"},{"attributes"
